import React from 'react';

const Header = () => {
    return ( 

        <div className="container-fluid">
            <div className="row">
                <div className="col-md-12 bg-primary">
                    <h2>Header aqui</h2>
                </div>
            </div>
        </div>
     );
}
 
export default Header;
